  "source": "// SPDX-License-Identifier: GPL-3.0\npragma solidity >=0.7.0 <0.9.0;\n\nimport \"@openzeppelin/contracts/token/ERC721/ERC721.sol\";\nimport \"@openzeppelin/contracts/access/Ownable.sol\";\nimport \"@openzeppelin/contracts/utils/Counters.sol\";\n/**\n    The struct describes a product model\n    Product model is described in this document\n    https://docs.google.com/document/d/1X7zGgsTgTLsbYk4EQ_WwPY3R7cXJhNns_-dXLs45WXw/edit#heading=h.64msh65jiiug\n */\nstruct Product {\n    string id;\n    string name;\n    string description;\n    string author;\n    string metadataURI;\n    string rewardURI;\n}\n\n/**\n    TokenData is a description model for a particular Item of Product\n */\nstruct TokenData {\n    string productId;\n    uint256 rank;\n    string couponCode;\n    bool isUnlocked;\n}\n\n/**\n    The struct is used to return combined data of Product and Item\n */\nstruct ItemDetails {\n    TokenData token;\n    Product product;\n}\n\n/// @title Geer products ownership via NFT.\ncontract GeerProducts is ERC721, Ownable{\n    /**\n        products mapping stores all the product types registered by contract owner;\n        key of type string is a string ID of product from external database\n     */\n    mapping(string => Product) public products;\n\n    // tokenData mapping stores all the information about particular instance of a product.\n    mapping(uint256 => TokenData) internal tokenData;\n\n    // productKeys array stores all the data about available product IDs\n    string[] public productKeys;\n\n    using Counters for Counters.Counter;\n    Counters.Counter private _tokenIds;\n    Counters.Counter private _productIds;\n\n    // This event gonna be triggered once the contract owner adds new product type to the system\n    event ProductRegistered(address _author, string indexed _productId);\n\n    constructor() ERC721(\"Juventus\", \"JUV\") {}\n     /**\n        mint method\n        argument productId {string} - product relation\n        argument rank {uint256} - rank or particular item\n        argument couponCode {string} - encrypted coupon code\n        argument isUnlocked {bool} - determines if a reward of the item is unlock\n     */\n    function mint(\n        string memory productId,\n        uint256 rank,\n        string memory couponCode,\n        bool isUnlocked\n    ) public onlyOwner returns (uint256) {\n        require(\n            bytes(products[productId].id).length > 0,\n            \"Given product ID does not exist\"\n        );\n\n        uint256 ID;\n        _tokenIds.increment();\n        ID = _tokenIds.current();\n        _safeMint(msg.sender, ID);\n        tokenData[ID] = TokenData(productId, rank, couponCode, isUnlocked);\n\n        return ID;\n    }\n\n\n    // This method allows us to change status of locked / unlocked reward for particular product instance (item)\n    function setIsUnlockedRewardForItem(\n        uint256 tokenDataId,\n        bool isUnlockedStatus\n    ) public onlyOwner {\n        tokenData[tokenDataId].isUnlocked = isUnlockedStatus;\n    }\n\n\n    // registerProductType method adds another Product to blockchain. All the items will have a relation to a product\n    function registerProductType(\n        string memory id,\n        string memory name,\n        string memory description,\n        string memory author,\n        string memory metadataURI,\n        string memory rewardURI\n    ) public onlyOwner {\n        products[id] = Product(\n            id,\n            name,\n            description,\n            author,\n            metadataURI,\n            rewardURI\n        );\n        productKeys.push(id);\n        emit ProductRegistered(msg.sender, id);\n    }\n\n    // Returns product associated with given productId\n    function getProductType(string memory productId)\n        public\n        view\n        returns (Product memory)\n    {\n        Product memory product = products[productId];\n        require(\n            bytes(products[productId].id).length > 0,\n            \"Given product ID does not exist\"\n        );\n        return product;\n    }\n\n    // Returns a number; the number is amount of all the product types registered in the contract\n    function productsAmount() public view returns (uint256) {\n        return uint256(productKeys.length);\n    }\n\n    // Returns item details (all the info related to the concrete token)\n    function getItemDetails(uint256 tokenId)\n        public\n        view\n        returns (ItemDetails memory)\n    {\n        TokenData memory token = tokenData[tokenId];\n        Product memory product = products[token.productId];\n        return ItemDetails(token, product);\n    }\n\n}\n",
